import Login from './Login'
import Nav from './Nav'


const Main = (props) =>{
    console.log(props.isLogged)
    if (props.isLogged){
        return(
            <div>
                <Nav/>
            </div>
        )
    }else{
        return(
            <div>
                <Login username={props.username} setUsername={props.setUsername}/>
            </div>
        )
    }
}

export default Main;
